import React, { useState } from "react";
import "./step6.scss";

export default function Step6({ nextStep, prevStep }) {
  const [formData, setFormData] = useState({
    sciana: "",
    scianagrubosc: "",
    izolacja: "",
    izolacjagrubosc: "",
    rok: "",
    termo: "",

  });

  const [scianaOptions, setScianaOptions] = useState([
    "beton komórkowy",
    "Ytong",
    "cegła",
    "silka",
    "porotherm",
    "zelbet",
    "drewno",
    "pustak zuzlowy",

  ]);
  const [izolacjaOptions, setIzolacjaOptions] = useState([
    "styropian biały",
    "styropian grafitowy",
    "wełna mineralna",
    "pianka poliuretanowa",
    "brak izolacji"
  ]);
  const [grzejnikOptions, setGrzejnikOptions] = useState([
    "płytowe",
    "zeliwne",
    "członowe",
    "podłogowe",
    "ogrzewanie piecowe lub kominkowe",

  ]);
  const [wentylOptions, setWentylOptions] = useState([
    "grawitacyjna",
    "mechaniczna wywiewna",
    "mechaniczna wywiewno-nawiewna",
  ]);



  // Funkcja obsługująca zmianę w inputach
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  console.log(formData);

  // Sprawdza, czy wszystkie pola są wypełnione
  const isFormValid = Object.values(formData).every(
    (value) => value.trim() !== ""
  );

  return (
    <div className="step6">
      <h2 className="merriweather-light">Szczegółowe dane nieruchomości</h2>

      <div className="inputs">
        <div className="input-wrapper">
          <select
            className="lato-light"
            name="sciana"
            value={formData.sciana}
            onChange={handleChange}
            required
          >
            <option value="" disabled>
              Materiał ścian zewnętrznych
            </option>
            {scianaOptions.map((option, index) => (
              <option key={index} value={option}>
                {option}
              </option>
            ))}
          </select>
        </div>
        <div className="input-wrapper">
          <input
            className="lato-light"
            type="number"
            name="scianagrubosc"
            value={formData.scianagrubosc}
            onChange={handleChange}
            required
          />
          <label className={`lato-light ${formData.scianagrubosc ? "active" : ""}`}>
            Grubość ściany zewnętrznej   [cm]
          </label>
        </div>




        <div className="input-wrapper">
          <select
            className="lato-light"
            name="izolacja"
            value={formData.izolacja}
            onChange={handleChange}
            required
          >
            <option value="" disabled>
              Materiał izolacji ściany zewnętrznej
            </option>
            {izolacjaOptions.map((option, index) => (
              <option key={index} value={option}>
                {option}
              </option>
            ))}
          </select>
        </div>
        <div className="input-wrapper">
          <select
            className="lato-light"
            name="grzejniki"
            value={formData.grzejniki}
            onChange={handleChange}
            required
          >
            <option value="" disabled>
              Rodzaj zainstalowanych grzejników
            </option>
            {grzejnikOptions.map((option, index) => (
              <option key={index} value={option}>
                {option}
              </option>
            ))}
          </select>
        </div>

        <div className="input-wrapper">
          <select
            className="lato-light"
            name="wentylacja"
            value={formData.wentylacja}
            onChange={handleChange}
            required
          >
            <option value="" disabled>
              Rodzaj wentylacji
            </option>
            {wentylOptions.map((option, index) => (
              <option key={index} value={option}>
                {option}
              </option>
            ))}
          </select>
        </div>

        <div className="input-wrapper">
          <input
            className="lato-light"
            type="number"
            name="szyby"
            value={formData.szyby}
            onChange={handleChange}
            required
          />
          <label className={`lato-light ${formData.szyby ? "active" : ""}`}>
            Liczba szyb w oknach [szt]
          </label>
        </div>
      </div>

      <button className="back" onClick={prevStep}>
        &#x2190;
      </button>
      <button onClick={nextStep} disabled={!isFormValid}>
        Dalej
      </button>
    </div>
  );
}
